/* eslint-disable jsx-a11y/img-redundant-alt */
import { Box, Container, Typography } from "@mui/material";

const Main = () => {
  return (
    <Container>
      <Box display="flex">
        <Box>
          <img
            alt="product-image"
            src="product-image.png"
            style={{ maxWidth: "575px" }}
          />
        </Box>

        <Typography fontSize="32px" color="#2C7EF8" noWrap overflow="visible">
          ONE TIME ONLY
        </Typography>
        <Typography fontSize="32px" noWrap overflow="visible">
          special price for 6 extra Clarifion for only
        </Typography>
        <Typography fontSize="32px" color="#2C7EF8" noWrap overflow="visible">
          $14 each
        </Typography>
        <Typography fontSize="32px" noWrap overflow="visible">
          ($84.00 total!)
        </Typography>
      </Box>
    </Container>
  );
};

export default Main;
